        if len(self.midpoints) == 0:
            return

        distances = np.linalg.norm(self.midpoints - self.vehicle_pos, axis=1)
        closest_idx = np.argmin(distances)

        if closest_idx < len(self.midpoints) - 20:
            farthest_point = self.midpoints[closest_idx + 20]
        else:
            farthest_point = self.midpoints[-1]

        closest_point = self.midpoints[closest_idx]
        
        # Calculate path_yaw
        delta_y = farthest_point[1] - closest_point[1]
        delta_x = farthest_point[0] - closest_point[0]
        path_yaw = np.arctan2(delta_y, delta_x)
        
        # Calculate heading error
        heading_error = self.vehicle_yaw
        # print(self.vehicle_yaw)
        print(heading_error)
        cross_track_error = np.linalg.norm(self.midpoints[closest_idx] - self.vehicle_pos)
        # print(np.arctan2(self.k * cross_track_error, self.gps_speed))
        steering_angle = heading_error #+ np.arctan2(self.k * cross_track_error, self.gps_speed)

        max_steering_angle = np.radians(25)
        steering_angle = np.clip(steering_angle, -max_steering_angle, max_steering_angle)

        mapped_steering_angle = np.interp(steering_angle, [-max_steering_angle, max_steering_angle], [1024, 86])
        print(mapped_steering_angle)
        # self.pub.publish(mapped_steering_angle)
        self.pub.publish(Int16(data=int(mapped_steering_angle)))  # std_msgs/Int16 형식에 맞게 수정
        self.rate.sleep()

